import Genre from "./Genre.jsx";
import styles from "../App.module.css";

function GenreList() {
	const genres = Genre();
	return (
		<ul className={styles.genre}>
		{genres.map(genre => <li key={genre}> {genre}</li>)}
		</ul>
	);
};

export default GenreList;
